import React from "react";

type Props = {
  question: string;
  answer: string[];
  callback: any;
  userAnswer: string;
  questionNr: number;
  totalQuestions: number;
};

const QCard: React.FC<Props> = ({
  answer,
  callback,
  question,
  questionNr,
  totalQuestions,
  userAnswer,
}) => {
  <div>
    <p className="number">
      Question: {questionNr} / {totalQuestions}
    </p>
    <p></p>
  </div>;
};

export default QCard;
